import React from 'react';
import { Paper, TextField, Container } from '@mui/material';
import { styled } from '@mui/system';

const StyledPaper = styled(Paper)`
  padding: 20px;
  box-shadow: 0px 2px 4px rgba(0, 0, 0, 0.2);
`;

const Create = () => {
  return (
    <Container maxWidth="sm">
      <StyledPaper>
        <TextField
          label="First Name"
          variant="outlined"
          fullWidth
          margin="normal"
        />
        <TextField
          label="Last Name"
          variant="outlined"
          fullWidth
          margin="normal"
        />
        <TextField
          label="Email"
          variant="outlined"
          fullWidth
          margin="normal"
        />
      </StyledPaper>
    </Container>
  );
};

export default Create;
